import React from 'react';
import { motion } from 'framer-motion';

function HowRelamWorks() {
  const sources = [
    { icon: '投', label: 'Property Data' },
    { icon: '倹', label: 'Web Signals' },
    { icon: 'ｧ鯛昨汳ｼ', label: 'Customer Lists' },
    { icon: '塘', label: 'Internal Docs' },
  ];

  const outputs = [
    { icon: '町', label: 'Slack' },
    { icon: '島', label: 'CRM' },
    { icon: '伯', label: 'API' },
    { icon: '投', label: 'Dashboard' },
  ];

  return (
    <section id="how-it-works" className="py-32 px-6 relative bg-white overflow-hidden">
      <div className="max-w-6xl mx-auto text-center">
        <h2 className="text-4xl font-bold mb-20 text-[#111827]">How Relam.ai Works</h2>

        {/* SOURCES */}
        <div className="flex flex-wrap justify-center gap-10 mb-12">
          {sources.map((source, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: index * 0.2 }}
              className="flex flex-col items-center"
            >
              <div className="text-4xl bg-[#f1f5fb] w-20 h-20 flex items-center justify-center rounded-full shadow-md mb-2">
                <motion.div
                  animate={{ y: [0, -5, 0] }}
                  transition={{ repeat: Infinity, duration: 3, ease: 'easeInOut' }}
                >
                  {source.icon}
                </motion.div>
              </div>
              <p className="text-[#4b5563] text-sm font-semibold">{source.label}</p>
            </motion.div>
          ))}
        </div>

        {/* Arrow Down */}
        <motion.div
          animate={{ y: [0, 8, 0] }}
          transition={{ repeat: Infinity, duration: 2, ease: 'easeInOut' }}
          className="text-2xl mb-6"
        >
          筮ｸ十n        </motion.div>

        {/* Section Title */}
        <h3 className="text-2xl font-bold text-[#111827] mb-12">
          Best-in-class AI and Computational Frameworks
        </h3>

        {/* ML Validation Engine */}
        <motion.div
          initial={{ opacity: 0, scale: 0.9 }}
          whileInView={{ opacity: 1, scale: 1 }}
          viewport={{ once: true }}
          transition={{ duration: 0.7 }}
          className="bg-[#ffffff] p-8 rounded-2xl shadow-xl border border-[#e0e7ff] max-w-3xl mx-auto mb-16"
        >
          <div className="flex flex-col md:flex-row items-center justify-between gap-8">
            {/* Left - KPIs */}
            <div className="flex flex-col gap-4 text-left">
              <div className="flex items-center gap-2">
                <span className="text-3xl">識</span>
                <div>
                  <p className="text-lg font-bold text-[#111827]">96% Accuracy</p>
                  <p className="text-sm text-[#6b7280]">Validated across property datasets</p>
                </div>
              </div>
              <div className="flex items-center gap-2">
                <span className="text-3xl">ｧｹ</span>
                <div>
                  <p className="text-lg font-bold text-[#111827]">90% Noise Reduction</p>
                  <p className="text-sm text-[#6b7280]">Using property computational frameworks</p>
                </div>
              </div>
            </div>

            {/* Right - Core Engine */}
            <div className="text-center">
              <div className="text-5xl mb-4">
                <motion.div
                  animate={{ y: [0, -5, 0] }}
                  transition={{ repeat: Infinity, duration: 3, ease: 'easeInOut' }}
                >
                  笞呻ｸ十n                </motion.div>
              </div>
              <p className="text-[#374151] font-semibold">ML Validation Engine</p>
            </div>
          </div>
        </motion.div>

        {/* Arrow Down */}
        <motion.div
          animate={{ y: [0, 8, 0] }}
          transition={{ repeat: Infinity, duration: 2, ease: 'easeInOut' }}
          className="text-2xl mb-6"
        >
          筮ｸ十n        </motion.div>

        {/* Contextual Insights */}
        <motion.div
          initial={{ opacity: 0, scale: 0.9 }}
          whileInView={{ opacity: 1, scale: 1 }}
          viewport={{ once: true }}
          transition={{ duration: 0.7 }}
          className="bg-[#f1f5fb] inline-block px-8 py-6 rounded-xl shadow-md text-lg font-semibold mb-16"
        >
          Contextual Insights
        </motion.div>

        {/* Arrow Down */}
        <motion.div
          animate={{ y: [0, 8, 0] }}
          transition={{ repeat: Infinity, duration: 2, ease: 'easeInOut' }}
          className="text-2xl mb-6"
        >
          筮ｸ十n        </motion.div>

        {/* OUTPUTS */}
        <div className="flex flex-wrap justify-center gap-10">
          {outputs.map((output, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: index * 0.2 }}
              className="flex flex-col items-center"
            >
              <div className="text-4xl bg-[#f1f5fb] w-20 h-20 flex items-center justify-center rounded-full shadow-md mb-2">
                <motion.div
                  animate={{ y: [0, -5, 0] }}
                  transition={{ repeat: Infinity, duration: 3, ease: 'easeInOut' }}
                >
                  {output.icon}
                </motion.div>
              </div>
              <p className="text-[#4b5563] text-sm font-semibold">{output.label}</p>
            </motion.div>
          ))}
        </div>

      </div>
    </section>
  );
}

export default HowRelamWorks;
